import "./App.css";
import { useState } from "react";
import Navigation from "./components/Navigation/Navigation";
import ImageLinkForm from "./components/ImageLinkForm/ImageLinkForm";
import Rank from "./components/Rank/Rank";
import FaceRecognition from "./components/FaceRecognition/FaceRecognition";

const App = () => {
  const [input, setInput] = useState("");
  const [responseJson, setResponseJson] = useState(null);


  const onInputChange = (e) => {
    setInput(e.target.value);
  };

  const onSubmit = () => {
    const PAT = 'ce7067f3d55a4e6d8fa87f4206545d5b';
    const USER_ID = '5hdnsuctgr7b';
    const APP_ID = 'my-first-application-fugwn';
    const MODEL_ID = 'face-detection';
    const IMAGE_URL = 'https://samples.clarifai.com/metro-north.jpg';

    const raw = JSON.stringify({
      "user_app_id": {
        "user_id": USER_ID,
        "app_id": APP_ID
      },
      "inputs": [
        {
          "data": {
            "image": {
              "url": IMAGE_URL
            }
          }
        }
      ]
    });

    const requestOptions = {
      method: 'POST',
      headers: {
        'Accept': 'application/json',
        'Authorization': 'Key ' + PAT
      },
      body: raw
    };

    fetch("https://api.clarifai.com/v2/models/" + MODEL_ID + "/outputs", requestOptions)
      .then(response => response.json()) // Parse response as JSON
      .then(result => {
        console.log(result);
        setResponseJson(result); // Update response JSON state
      })
      .catch(error => console.log('error', error));
    setImageUrl(input)
  };

  return (
    <div className="App text-center">
      <Navigation />
      <Rank />
      <ImageLinkForm submit={onSubmit} onInputChange={onInputChange} />
      <pre>{JSON.stringify(responseJson, null, 2)}</pre>
      <FaceRecognition imageUrl={imageUrl} />
    </div>
  );
};

export default App;
